        self.B_help.setToolTip(_translate("AppMainWindow", "<html><head/><body><p><span style=\" font-weight:700;\">Část B</span> kalkulačky zahrnuje nepovinné vstupní parametry. V případě, že se jedná o síťovou infrastrukturu, kde není žádná přípojka aktivní, tedy koncový bod sítě (NTP) nebo se jedná o plánování výstavby/projektovou činnost, je zřejmé, že nelze posuzovat výsledky monitoringu síťového provozu (nulové hodnoty). Lze pouze posuzovat výkonnost síťové infrastruktury jako celku, resp. její schopnosti zajistit požadovanou kapacitu v čase.</p></body></html>"))
