        self.mtu_l_u.setText(_translate("AppMainWindow", "B"))
        self.A1_help.setToolTip(_translate("AppMainWindow", "<html><head/><body><p><span style=\" font-weight:700;\">VSTUP 1:</span> Identifikujte úzké hrdlo distribuční (přípojné) sítě elektronických komunikací (bottleneck), kapacitu identifikovaného úzkého hrdla v Mb/s (L1) zapište do příslušného políčka A.1. </p><p><span style=\" font-weight:700;\">Příklad: </span><span style=\" font-style:italic;\">Optická přístupová technologie GPON s dělícím poměrem pasivní infrastruktury 1:256 (kategorie C). Konektivita centrální jednotky OLT je zajištěna pomocí SFP+ s kapacitou 10 Gb/s (IEEE 802.3ae). Úzké hrdlo bude v tomto případě samotná SFP technologie GPON (ITU-T G.984), která ve směru downstream umožňuje maximální rychlost 2488 Mb/s (L1).</span></p></body></html>"))
        self.A_help.setToolTip(_translate("AppMainWindow", "<html><head/><body><p><span style=\" font-weight:700;\">Část A</span> kalkulačky zahrnuje povinné vstupní parametry posuzované sítě elektronických komunikací, které odpovídají vždy identifikovanému úzkému hrdlu síťové infrastruktury od přípojné sítě (backhaul) až po konkrétní přípojnou síť (přípojku), tedy po koncový bod sítě (NTP; BEREC BoR (20) 46).</p></body></html>"))
        self.A2_help.setToolTip(_translate("AppMainWindow", "<html><head/><body><p><span style=\" font-weight:700;\">VSTUP 2:</span> Uveďte hodnotu MTU používanou v rámci posuzované distribuční (přípojné) sítě s ohledem na koncový bod sítě (NTP), nikoliv s ohledem na posuzované úzké hrdlo.</p><p><span style=\" font-weight:700;\">Příklad: </span><span style=\" font-style:italic;\">Standardní hodnotou MTU je 1500 B pro uživatelské rozhraní koncového bodu sítě (NTP), nicméně v případě, kdy je v rámci síťové infrastruktury využíváno protokolu PPPoE, bude MTU v místě NTP odpovídat hodnotě 1492 B.</span></p></body></html>"))
        self.A3_help.setToolTip(_translate("AppMainWindow", "<html><head/><body><p><span style=\" font-weight:700;\">VSTUP 3:</span> Uveďte, jakým protokolem síťové vrstvy je (bude) služba přístupu k internetu poskytována, buď IPv4, potom bude velikost IP záhlaví odpovídat nejčastěji hodnotě 20 B, nebo IPv6, potom bude velikost IP záhlaví odpovídat nejčastěji hodnotě 40 B. V případě záhlaví transportní vrstvy je předpokládaná velikost 20 B pro TCP protokol (SDR) a 8 B pro UDP protokol (šířka pásma). </p><p><span style=\" font-weight:700;\">Příklad: </span><span style=\" font-style:italic;\">Služba přístupu k síti internet bude poskytována prostřednictvím protokolu IPv4, velikost záhlaví bude tedy 20 B.</span></p></body></html>"))
        self.A4_help.setToolTip(_translate("AppMainWindow", "<html><head/><body><p><span style=\" font-weight:700;\">VSTUP 4:</span> Uveďte počet koncových bodů sítě (NTP), na které má dopad posuzovaná hodnota kapacity (šířky pásma) úzkého hrdla. </p><p><span style=\" font-weight:700;\">Příklad:</span><span style=\" font-style:italic;\">Identifikované úzké hrdlo v podobě distribuční sítě zajišťuje kapacitu pro 3 lokality GPON přístupovou technologií s identickou centrální jednotkou OLT (stejným GPON portem), přičemž je současně disponibilních/je aktivováno 256 přípojek, tedy 256 koncových bodů sítě (NTP). </span></p></body></html>"))
