        self.D_help.setToolTip(_translate("AppMainWindow", "<html><head/><body><p><span style=\" font-weight:700;\">Část D</span> kalkulačky představuje výsledek dopadu agregace na základě Poissonova procesu, a to s ohledem na identifikovanou kapacitu úzkého hrdla (bottleneck) a průměrný počet disponibilních/aktivních přípojek, tedy koncových bodů sítě (NTP).</p><p><span style=\" font-weight:700;\">Výstup 1:</span> Výsledná hodnota průměrné SDR (bez UF) popisuje výkonost posuzované infrastruktury v místě disponibilní přípojky, tedy koncového bodu sítě (NTP), za předpokladu plného využití šířky pásma sítě (položka A.1) identifikovaného úzkého hrdla, zatímco výsledná hodnota průměrné SDR (s UF) popisuje aktuální výkonost síťové infrastruktury v místě NTP s ohledem na dostupnou kapacitu sítě (položka A.1) a chování koncových uživatelů dle monitoringu síťového provozu (položka B.3). Oba výsledky odpovídají rychlosti na transportní vrstvě (L 4), tedy TCP propustnosti.</p></body></html>"))
