        self.E5_help.setToolTip(_translate("AppMainWindow", "<html><head/><body><p><span style=\" font-weight:700;\">Výstup 5:</span> Výsledná průměrná hodnota potřebné kapacity sítě (L 3) v místě identifikovaného úzkého hrdla síťové infrastruktury odpovídá počtu identifikovaných koncových bodů sítě (NTP), tedy aktivních přípojek (položka A.4), při požadované rychlosti SDR (položka E.1) a současně s dopadem typického chování koncových uživatelů dle monitoringu síťového provozu (položka B.3) v dané lokalitě v místě koncového bodu sítě (NTP). Případný způsob ověření bude vycházet ze standardu ITU-T Y.1540.</p></body></html>"))
